import React from "react";
import CopyrightIcon from '@material-ui/icons/Copyright';
const Footer=()=>{


    return(

         <>

        <footer>
        <div className="col-12 bg-dark text-white">
            <div className="row">
                <div className="col-12 m-0 p-0 text-center">
        
           
           
            <p className="pt-2 pb-2 mb-0" style={{fontSize:'12px'}}> <CopyrightIcon /><span>2020 Jay. All Rights Reserved | Terms and Condition</span></p>
        
           
      



            </div>
            </div>
        </div>
        </footer> 




        </>



    )
}
export default Footer;
